<!DOCTYPE html>
<html lang="pt-br">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Carregando...</title>
    <style>
        body, html {
            margin: 0;
            padding: 0;
            width: 100%;
            height: 100%;
            overflow: hidden;
            background-color: #132440; /* Fundo escuro */
        }

        .loading-container {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            display: flex;
            justify-content: center;
            align-items: center;
            z-index: 9999;
            opacity: 1;
            transition: opacity 0.8s ease-out; 
        }
        
        .loading-hidden {
            opacity: 0;
            pointer-events: none;
        }

        #logo-animada {
            width: 250px;
            max-width: 100%;

            /* 1. ESTADO INICIAL: Começa do zero e invisível */
            transform: scale(0);
            opacity: 0;

            /* 2. INSTRUÇÃO: Se 'transform' ou 'opacity' mudarem, faça uma transição suave de 1.2s */
            transition: transform 1.2s ease-out, opacity 1.2s ease-out;
        }

        /* 3. ESTADO FINAL: Totalmente visível e no tamanho normal */
        #logo-animada.visible {
            transform: scale(1);
            opacity: 1;
        }

    </style>
</head>

    <script>
        document.addEventListener("DOMContentLoaded", function() {
            const loadingScreen = document.getElementById('loadingScreen');
            const logo = document.getElementById('logo-animada');

            // O TRUQUE: Espera um instante antes de adicionar a classe 'visible'
            // Isso força o navegador a registrar o estado inicial antes de começar a animar.
            setTimeout(() => {
                logo.classList.add('visible');
            }, 50); // 50 milissegundos é o suficiente

            // Tempo total de espera: 1.2s da animação + 1s de pausa
            const totalWaitTime = 2000; 

            setTimeout(() => {
                loadingScreen.classList.add('loading-hidden');
                
                // Espera o fade-out de 800ms terminar para redirecionar
                setTimeout(() => {
                    window.location.href = 'index.html'; // Altere para a página do seu app
                }, 800);

            }, totalWaitTime);
        });
    </script>
